import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  render(){
      return (
        <div>
          <nav class="navbar navbar-inverse">
            <div class="container-fluid">
              <a class="navbar-brand">Title</a>
              <ul class="nav navbar-nav">
                <li class="active">
                  <a>Home</a>
                </li>
                <li>
                  <a>Link</a>
                </li>
              </ul>
            </div>
          </nav> 
        </div> 
      );
  }

}

export default App;
